import classes from "./cart.module.css";
import classes2 from "./modal.module.css";
import CartItem from "./CartItem";
import react from "react";
import React from "react";

export default function Backdrop(props) {
  return (
    
        <React.Fragment>
      <div className={classes2.backdrop}></div>
      <div className={classes2.modal}>
      <CartItem/>
        <div className={classes.total}>
          <h2>Total:</h2>
        </div>
        <div className={classes.actions}>
          <button className={classes["button--alt"]}>Order</button>
          <button className={classes.button} onClick={props.onHideClick}>Close</button>
        </div>
      </div>
      </React.Fragment>
        
  );
}
